import React from "react"; 
import { useNavigate } from "react-router-dom";

const OutputDisplay = ({ result }) => {
  const navigate = useNavigate();

  // Define function to handle "Store Output"
  const handleStoreOutput = () => {
    console.log("Storing output:", result);
    // Add API call logic to store the result if needed
  };

  return (
    <div style={{ textAlign: "center", marginTop: "50px" }}>
      <h2>Output</h2>
      <p><strong>URL:</strong> https://example.com</p>
      <p><strong>Prediction:</strong> {result}</p>

      <button onClick={handleStoreOutput} style={{ marginRight: "10px" }}>
        Store Output
      </button>
      <button onClick={() => navigate("/")}>Go Back</button>
    </div>
  );
};

export default OutputDisplay;
